import { createIcon } from "../icon/createIcon";

export const TreeIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="TreeIcon">
    <path d="M10 7H2v1h2v4H0V8h1V6h4.5V5H4V1h4v4H6.5v1H11v2h1v4H8V8h2V7zM3 9H1v2h2V9zm8 0H9v2h2V9zM7 2H5v2h2V2z" />
  </svg>,
  "Tree",
  "tree"
);
